export default function App() {

    return (
            <Container>
                <Clubs label={'Club'} totalSeats={20}>

                </Clubs>
                <hr/>
                <Clubs label={'Executive'}  totalSeats={30}>

                </Clubs>

                <hr/>
            </Container>
    );
}
